import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';
import Ident from '../Identification/Identification';
import AdminPanel from '../AdminPanel/AdminPanel';
import DirectorPanel from '../DirectorPanel/DirectorPanel';

function App() {
  return (
    <BrowserRouter>
      <Switch>

        <Route exact path="/login">
          <Ident></Ident>
        </Route>

        <Route exact path="/account/admin">
          <AdminPanel></AdminPanel>
        </Route>

        <Route exact path="/account/director">
          <DirectorPanel></DirectorPanel>
        </Route>

        <Route exact path="/account/reception">
        </Route>

        <Route exact path="/account/doctor">
        </Route>

      </Switch>
    </BrowserRouter>
  );
}

export default App;
